import React from 'react';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';

function TypographyExample() {
  return (
    <Container maxWidth="lg"> {/* Adjust max-width as needed */}
      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          <Typography variant="h1">Responsive Typography</Typography>
          <Typography variant="subtitle1">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</Typography>
        </Grid>
        <Grid item xs={12} md={6}>
          <Typography variant="h2">Second Column</Typography>
          <Typography variant="body1">Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</Typography>
        </Grid>
      </Grid>
    </Container>
  );
}

export default TypographyExample;
